import React from "react";

class Title extends React.Component{

    constructor(props){
        super(props);

        this.state={
            title: "dummy title",
            isInput: false
        };
    }



    render() {
        let output=<div>hello from title!</div>
        return(
            <div>{output}</div>
        );

    }
}

export default Title;
